def merge_lora_model_properly():
    """
    FIXED merge function that works with vLLM.
    Key fixes:
    1. Use SAME base model for both model and tokenizer (gemma-3-1b-pt)
    2. Save in float16 for compatibility
    3. Ensure all files are saved properly
    """
    from transformers import AutoModelForCausalLM, AutoTokenizer
    from peft import PeftModel
    import os

    print("="*60)
    print("STEP 1: PROPER LoRA MERGE FOR VLLM")
    print("="*60)

    BASE_MODEL = "google/gemma-3-1b-pt"  # Use PT for consistency
    ADAPTER_PATH = os.path.abspath("gemma3-1B-ctrl-alt-del-h8_V2")
    OUTPUT_DIR = "gemma3-1B-merged"

    print("\n📥 Loading base model...")
    base_model = AutoModelForCausalLM.from_pretrained(
        BASE_MODEL,
        torch_dtype=torch.float16,  # Use FP16 for broad compatibility
        device_map="auto",
        low_cpu_mem_usage=True
    )

    print("\n🔧 Loading LoRA adapter...")
    model = PeftModel.from_pretrained(base_model, ADAPTER_PATH)

    print("\n🔀 Merging adapter...")
    merged_model = model.merge_and_unload()

    print("\n💾 Saving merged model properly...")
    os.makedirs(OUTPUT_DIR, exist_ok=True)

    # Save model with all necessary files
    merged_model.save_pretrained(
        OUTPUT_DIR,
        safe_serialization=True,  # Use safetensors
        max_shard_size="5GB"
    )

    # CRITICAL: Save tokenizer from SAME base model
    print("💾 Saving tokenizer from same base...")
    tokenizer = AutoTokenizer.from_pretrained(BASE_MODEL, use_fast=True)
    tokenizer.save_pretrained(OUTPUT_DIR)

    print(f"\n✅ Merge complete! Saved to: {OUTPUT_DIR}")
    print("\n🔍 Verifying saved files...")
    files = os.listdir(OUTPUT_DIR)
    required_files = ["config.json", "tokenizer.json", "tokenizer_config.json"]
    for req_file in required_files:
        if req_file in files:
            print(f"   ✓ {req_file}")
        else:
            print(f"   ✗ {req_file} MISSING!")

    return OUTPUT_DIR

