def run_inference_vllm_fixed(merged_model_path="gemma3-1B-merged"):
    """
    vLLM inference with ALL the fixes:
    - dtype="auto" (not bfloat16)
    - Lower gpu_memory_utilization
    - Proper tokenizer handling
    - No trust_remote_code
    """
    from vllm import LLM, SamplingParams
    from transformers import AutoTokenizer

    print("\n" + "="*60)
    print("VLLM INFERENCE - FIXED")
    print("="*60)

    # Load tokenizer for chat formatting
    print("\n📥 Loading tokenizer...")
    tokenizer = AutoTokenizer.from_pretrained("google/gemma-3-1b-it", use_fast=True)

    # Initialize vLLM with SAFE settings
    print("\n🚀 Initializing vLLM...")
    try:
        llm = LLM(
            model=merged_model_path,
            dtype="auto",  # CRITICAL: Let vLLM choose (not bfloat16)
            gpu_memory_utilization=0.70,  # Lower from 0.9
            max_model_len=4096,
            # DO NOT set trust_remote_code=True
        )
    except Exception as e:
        print(f"\n❌ vLLM initialization failed: {e}")
        print("\nTroubleshooting:")
        print("1. Check GPU compatibility (T4/V100 need float16, not bfloat16)")
        print("2. Verify merge was done properly")
        print("3. Try lower gpu_memory_utilization (0.5)")
        raise

    # Sampling params with proper stop conditions
    sampling_params = SamplingParams(
        temperature=0.0,
        max_tokens=2048,
        stop=["<end_of_turn>", "</s>", "\n}\n", "}\n\n"],
        stop_token_ids=[tokenizer.eos_token_id] if hasattr(tokenizer, 'eos_token_id') else None,
    )

    # Load test data
    print("\n📁 Loading test data...")
    test_data = load_dataset("json", data_files="test_aggregated.jsonl", split="train")
    print(f"Test dataset size: {len(test_data)}")

    # Prepare prompts
    print("\n📝 Preparing prompts...")
    prompts = []
    for sample in tqdm(test_data, desc="Formatting"):
        prompt_text = INSTRUCTION.format(text=sample['text'])
        formatted_prompt = tokenizer.apply_chat_template(
            [{"role": "user", "content": prompt_text}],
            tokenize=False,
            add_generation_prompt=True
        )
        prompts.append(formatted_prompt)

    # Run inference
    print(f"\n⚡ Running vLLM inference on {len(prompts)} samples...")
    print("   This should take 2-5 minutes...")

    outputs = llm.generate(prompts, sampling_params)

    # Process results
    print("\n📊 Processing results...")
    predictions = []
    failed_samples = []

    for i, output in enumerate(tqdm(outputs, desc="Processing")):
        sample = test_data[i]
        generated_text = output.outputs[0].text.strip()

        try:
            predicted_json_str = extract_outer_json(generated_text)
            normalized_prediction = normalize_schema(predicted_json_str)
            normalized_expected = normalize_schema(sample)

            predictions.append({
                "comment_id": sample.get("comment_id"),
                "text": sample.get("text"),
                "expected": normalized_expected,
                "predicted": normalized_prediction,
                "raw_output": generated_text,
                "success": True
            })
        except Exception as e:
            failed_samples.append({
                "comment_id": sample.get("comment_id"),
                "text": sample.get("text"),
                "expected": normalize_schema(sample),
                "raw_output": generated_text,
                "error": str(e)
            })
            predictions.append({
                "comment_id": sample.get("comment_id"),
                "text": sample.get("text"),
                "success": False
            })

    # Save results
    print("\n💾 Saving results...")
    with open("gemma_test_predictions_vllm.jsonl", "w") as f:
        for pred in predictions:
            f.write(json.dumps(pred) + "\n")

    if failed_samples:
        with open("failed_predictions_vllm.jsonl", "w") as f:
            for failed in failed_samples:
                f.write(json.dumps(failed) + "\n")

    success_rate = (len(predictions) - len(failed_samples)) / len(predictions)
    print(f"\n✅ Inference complete!")
    print(f"   Total: {len(predictions)}")
    print(f"   Success: {len(predictions) - len(failed_samples)} ({success_rate:.1%})")
    print(f"   Failed: {len(failed_samples)}")

    return predictions

